import boto3
import json
import random
from datetime import datetime
import uuid
import sys

# === INLINE AWS CREDENTIALS (use temporary or IAM user credentials with Bedrock access) ===
bedrock = boto3.client(
    "bedrock-runtime",
    region_name="us-gov-west-1",
    aws_access_key_id="XXXXX",
    aws_secret_access_key="XXXXX"
)

MODEL_ID = "amazon.titan-text-express-v1"

def build_prompt(transcript_text):
    return f"""
You are an emergency response AI assistant. Your only job is to extract structured fields from 911 call transcripts.

⚠️ IMPORTANT: Your response MUST BE A VALID JSON OBJECT and NOTHING ELSE. Do NOT include introductions, explanations, or markdown.

Only respond with a JSON object using this exact format:

{{
  "incident_type": string,
  "call_priority": "Low" | "Medium" | "High" | "Critical",
  "transcription_keywords": [string, ...],
  "caller_sentiment": "Calm" | "Distressed" | "Panicked",
  "suspected_substances": [string, ...],
  "ai_crisis_classification": string,
  "summary_notes": string
}}

Analyze this 911 call transcript and extract the fields:

\"\"\"{transcript_text}\"\"\"
"""

def call_bedrock(prompt):
    response = bedrock.invoke_model(
        modelId=MODEL_ID,
        body=json.dumps({
            "inputText": prompt,
            "textGenerationConfig": {
                "temperature": 0.7,
                "maxTokenCount": 1024,
                "topP": 0.9,
                "stopSequences": []
            }
        }),
        contentType="application/json",
        accept="application/json"
    )

    raw_output = response["body"].read().decode("utf-8")

    try:
        parsed = json.loads(raw_output)
        output_text = parsed.get("results", [{}])[0].get("outputText", "").strip()

        if not output_text:
            raise ValueError("Bedrock model returned empty outputText")

        return json.loads(output_text)

    except Exception as e:
        print(f"ERROR: Failed to parse Bedrock response: {e}", file=sys.stderr)
        print("RAW output:", raw_output, file=sys.stderr)
        sys.exit(1)

def extract_parts(content):
    # Find the first valid JSON block
    json_start = content.find('{')
    brace_stack = 0
    json_end = 0

    for i in range(json_start, len(content)):
        if content[i] == '{':
            brace_stack += 1
        elif content[i] == '}':
            brace_stack -= 1
            if brace_stack == 0:
                json_end = i + 1
                break

    if json_end == 0:
        raise ValueError("No valid JSON found")

    metadata_json = content[json_start:json_end]
    transcript_raw = content[:json_start] + content[json_end:]
    return json.loads(metadata_json), transcript_raw.strip()

# ==== MAIN ====
if __name__ == "__main__":
    content = sys.stdin.read()

    if not content.strip():
        print("ERROR: Empty input from FlowFile", file=sys.stderr)
        sys.exit(1)

    try:
        metadata, transcript = extract_parts(content)
    except Exception as e:
        print(f"ERROR parsing input: {e}", file=sys.stderr)
        sys.exit(1)

    ai_result = call_bedrock(build_prompt(transcript))

    metadata.update({
        "incident_type": ai_result["incident_type"],
        "call_priority": ai_result["call_priority"],
        "transcription_keywords": ai_result["transcription_keywords"],
        "emotion_analysis": {
            "caller_sentiment": ai_result["caller_sentiment"],
            "urgency_score": round(random.uniform(6.0, 10.0), 1),
            "agitation_level": random.choice(["Low", "Moderate", "High"])
        },
        "suspected_substances": ai_result["suspected_substances"],
        "notes": ai_result["summary_notes"],
        "ai_crisis_classification": {
            "classified_as": ai_result["ai_crisis_classification"],
            "confidence": round(random.uniform(0.85, 0.98), 2),
            "model_version": MODEL_ID
        }
    })

    print(json.dumps(metadata, indent=2))
